class Prod {
    constructor(props){
        this.name = props.name
        this.price = props.price
        this.img = props.img
        this.hover = props.hover
        this.slider = props.slider
        this.desc = Object.assign(this.desc, props.desc)
    }
}

let allProducts = [
    new Prod(
        name = 'alina'
    ),

    new Prod(
        name = 'zalaup'
    )
]


export {allProducts}
